DROP TABLE IF EXISTS public.mx_countries CASCADE;

CREATE TABLE public.mx_countries (
    gid bigint NOT NULL,
    geom public.geometry(MultiPolygon,4326),
    adm0_name character varying,
    iso3code character varying,
    status character varying,
    disp_area character varying,
    m49_region_code character varying(7),
    m49_subregion_code character varying(7),
    m49_intermediate_region_code character varying(7)
);

ALTER TABLE public.mx_countries OWNER TO mapxw;


ALTER TABLE ONLY public.mx_countries
    ADD CONSTRAINT "mx_countries_pkey" PRIMARY KEY (gid);

CREATE INDEX "sidx_mx_countries_geom" ON public.mx_countries USING gist (geom);

GRANT SELECT ON TABLE public.mx_countries TO readonly;
